import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import AddIcon from '@material-ui/icons/Add';
import SubtractIcon from '@material-ui/icons/Remove';
import DeleteIcon from '@material-ui/icons/Delete';
import axios from 'axios';
import image from '../../../images/image2.JPG';

import { CircularProgress } from '@material-ui/core';
import { Button } from '@material-ui/core';

const CustomerOrders = () => {

    const useStyles = makeStyles((theme) => ({
        root: {
          display: 'flex',
        },
        details: {
          display: 'flex',
          flexDirection: 'column',
          width: '65%',
        },
        content: {
          flex: '1 0 auto',
        },
        cover: {
          width: 151,
          cursor: 'pointer',
        },
        controls: {
          display: 'flex',
          alignItems: 'center',
          paddingLeft: theme.spacing(1),
          paddingBottom: theme.spacing(1),
        },
        container: {
            width: '100%',
            margin: 'auto',
        },
        price: {
            color: 'white',
            fontWeight: 'bold',
            backgroundColor: 'maroon',
            padding: '10px',
            width: '70px',
            borderRadius: '15%',
        }
      }));

      const classes = useStyles();

    return (
        <div>
            <h3>This is Customer Orders</h3>
            <div className={classes.container}>
            <Card className={classes.root}>
                <CardMedia
                    className={classes.cover}
                    image={image}
                    title="Product Details"
                />
                <div className={classes.details}>
                    <CardContent className={classes.content}>
                    <Typography component="h5" variant="h5">
                        BENARASI SILK SAREE
                    </Typography>
                    <Typography variant="subtitle1" color="textSecondary">
                        Pure Silk Hand Women Benarasi Saree
                    </Typography>
                    <Typography variant="subtitle1" className={classes.price}>
                        19000.00
                    </Typography>
                    </CardContent>
                    <div className={classes.controls}>
                    
                    <Typography variant="subtitle1" style={{marginLeft: '15px', marginRight: '50px'}}>
                        Qty: 2
                    </Typography>
                    <Typography variant="subtitle1">
                        Total Price: 38000.00
                    </Typography>
                    <Button style={{backgroundColor: '#FFC300'}}>Proceed to Buy</Button>

                    </div>
                </div>
            </Card>
        </div>
        </div>
    )
}

export default CustomerOrders;
